    vector<int> p(n), c(n);
    set<int> s;
    for(int i = 0; i < n; i++) {
        s.insert(i);
    }
    for(int i = 0; i < n; i++) {
        cin >> p[i];
    }
    for(int i = 0; i < n; i++) {
        cin >> c[i];
    }
    int q;
    cin >> q;
    vector<int> qq(q), ans(q);
    for(int i = 0; i < q; i++) {
        cin >> qq[i];
        qq[i]--;
        s.erase(qq[i]);
    }
    int id = 0;
    vector<int> ic(m + 1), in(n + 1), out(n + 1);
    for(int i = 1; i <= m; i++) {
        ic[i] = id++;
    }
    for(int i = 0; i <= n; i++) {
        in[i] = id++;
    }
    for(int i = 0; i <= n; i++) {
        out[i] = id++;
    }
    int src = id++;
    int sink = id++;
    Dinic<int> dinic(sink + 1);
    for(int i = 1; i <= m; i++) {
        dinic.addEdge(src, ic[i], 1);
    }
    for(int i = 0; i < n; i++) {
        dinic.addEdge(out[i], out[i + 1], i + 1);
    }
    for(int i = 0; i <= n; i++) {
        dinic.addEdge(in[i], out[i], 1);
    }
    dinic.addEdge(out[n], sink, n + 1);
    for(auto e : s) {
        dinic.addEdge(ic[c[e]], in[p[e]], 1);
    }
    auto res = dinic;
    int sz = s.size(), curans = 0;
    for(int i = q - 1; i >= 0; i--) {
        while(res.maxFlow(src, out[curans]) == curans) {
            curans++;
        }
        ans[i] = curans;
        dinic.addEdge(ic[c[qq[i]]], in[p[qq[i]]], 1);
        res = dinic;
    }
    for(int i = 0; i < q; i++) {
        cout << ans[i] << "\n";
    }
    return 0;
}

